"""# **All Functions Definition**

Since generators produce infinite data in a loop,we have to `break` after seeing all the images, at some point.
"""

def data_download(file_to_download, gdrive_code, OS):
  if not os.path.exists(file_to_download):
    os.system('gdown --id "'+gdrive_code+'" --output '+file_to_download)
    if OS == "Linux":
        os.system('unzip -o -n "./'+file_to_download+'" -d "./"')

def feature_extractor(ccn, generator, sample_count, test_batch_size):
    features = np.zeros(shape=(sample_count, 4, 4, 512))
    labels = np.zeros(shape=(sample_count))

    i = 0
    for inputs_batch, labels_batch in generator:
        features_batch = cnn.predict(inputs_batch)
        features[i * test_batch_size : (i + 1) * test_batch_size] = features_batch
        labels[i * test_batch_size : (i + 1) * test_batch_size] = labels_batch
        i += 1
        if i * test_batch_size >= sample_count:
            break
    return features, labels

"""# **All Downloads**"""

start_time = timeit.default_timer()
# Operating System
OS = platform.system()                           # returns 'Windows', 'Linux', etc

os.system('pip install --upgrade --no-cache-dir gdown')

data_download("./cats_and_dogs_small.zip", "1jcSSoGmeHTlpyTjiEf5cxAr8d_uLnrHI", OS)

print("Elapsed Time: ", timeit.default_timer() - start_time)

"""# **All Globals** """

n_epochs = 30
train_batch_size = 20
test_batch_size = 20
save_best_model = True
early_stopping = False
log = True
R_LR_P = False
default_callbacks = []
train_dir = "/content/cats_and_dogs_small/train"
validation_dir = "/content/cats_and_dogs_small/validation"
test_dir = "/content/cats_and_dogs_small/test"
save_best_model = True
early_stopping = False
log = True
R_LR_P = False

"""#**Quick Feature Extraction with no Data Augmentation**

A quick effective approach to small image datasets is to take advantage of a pre-trained network. We can consider a neural network trained on ImageNet (where classes are mostly animals and everyday objects) and then re-use this trained network for something else. Furthermore we can use this approach to train models on **smartphones** o small devices.

# **Preprocessing**

Images are rescaled by 1./255 with ImageDataGenerator instead of classical Normalization formula
"""

n_train_files = len(glob.glob(train_dir+'/**/*', recursive=True))-2
n_validation_files = len(glob.glob(validation_dir+'/**/*', recursive=True))-2
n_test_files = len(glob.glob(test_dir+'/**/*', recursive=True))-2

n_train_batches = n_train_files // train_batch_size
n_val_batches = n_validation_files // test_batch_size
n_test_batches = n_test_files // test_batch_size

print("Number of Training Set Batches: ", n_train_batches)
print("Number of Validation Set Batches: ", n_val_batches)
print("Number of Test Set Batches: ", n_test_batches)

train_datagen = ImageDataGenerator(rescale=1./255)
val_datagen = ImageDataGenerator(rescale=1./255)
test_datagen = ImageDataGenerator(rescale=1./255)

train_generator = train_datagen.flow_from_directory(
        train_dir,
        target_size = (150, 150),
        batch_size = test_batch_size,
        class_mode = 'binary')

validation_generator = val_datagen.flow_from_directory(
        validation_dir,
        target_size=(150, 150),
        batch_size=test_batch_size,
        class_mode = 'binary')

test_generator = test_datagen.flow_from_directory(
        test_dir,
        target_size=(150, 150),
        batch_size=test_batch_size,
        class_mode = 'binary')

"""# **Pre-trained Deep Model Definition**

![download.jfif](data:image/jpeg;base64,)
"""

cnn = VGG16(weights='imagenet', include_top=False, input_shape=(150, 150, 3))
#cnn = VGG16(weights='imagenet')
cnn.summary()

"""# **Feature Extraction**

![41598_2019_48995_Fig1_HTML.jpg](data:image/jpeg;base64,)

Feature extraction consists of using the internal representations learned by a previous network to extract interesting features from new samples. These features are then run through a new classifier, which is trained from scratch.
"""

train_features, train_labels = feature_extractor(cnn, train_generator, n_train_files, test_batch_size)
validation_features, validation_labels = feature_extractor(cnn, validation_generator, n_validation_files, test_batch_size)
test_features, test_labels = feature_extractor(cnn, test_generator, n_test_files, test_batch_size)

"""# **Training Regularizers**"""

if save_best_model: 
  check_point = ModelCheckpoint("cats_and_dogs_best.h5", save_weights_only = True, monitor = "val_accuracy", verbose = 1, save_best_only = True, mode = "max")
  default_callbacks = default_callbacks + [check_point]

if early_stopping: 
  earlyStopping = EarlyStopping(monitor = 'val_loss', min_delta = 0.001, patience = 10, verbose = 0, mode = 'min') 
  default_callbacks = default_callbacks + [earlyStopping]

if log: 
  csv_logger = CSVLogger('history.log')
  default_callbacks = default_callbacks + [csv_logger]

if R_LR_P: 
  reduce_lr_plateau = ReduceLROnPlateau(factor=0.1, patience=3, verbose=1, min_lr=1e-06, min_delta=0.01)
  default_callbacks = default_callbacks + [reduce_lr_plateau]

"""# **Secondary Light Shallow Model Definition**

![image.png](data:image/png;base64,)
"""

model = Sequential()
model.add(Flatten(input_shape = (4, 4, 512)))
model.add(Dense(256, activation='relu'))
model.add(Dropout(0.5))
model.add(Dense(1, activation='sigmoid'))

opt = Adam(lr=2e-5)
model.compile(optimizer=opt, loss='binary_crossentropy',  metrics=['accuracy'])
model.summary()

"""# **Secondary Light Shallow Model Training**

Reshaping and flattening for the mlp shallow model
"""

history = model.fit(train_features, train_labels, epochs=n_epochs, batch_size=train_batch_size, validation_data=(validation_features, validation_labels), callbacks = default_callbacks)

acc = history.history['accuracy']
val_acc = history.history['val_accuracy']
loss = history.history['loss']
val_loss = history.history['val_loss']

epochs = range(len(acc))

plt.plot(epochs, acc, 'bo', label='Training Accuracy')
plt.plot(epochs, val_acc, 'b', label='Validation Accuracy')
plt.title('Training and validation accuracy')
plt.legend()

plt.figure()

plt.plot(epochs, loss, 'bo', label='Training loss')
plt.plot(epochs, val_loss, 'b', label='Validation loss')
plt.title('Training and validation loss')
plt.legend()

plt.show()

